Relationship.create([subject_id: (Resource.find_by literal: 'T0000642').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "تطوير افتراضات في النظرية الاقتصادية باستخدام أساليب رمزية في التفكير. يستخدم المصطلح عادة للمعالجة المجردة للموضوع. للتحقق من النظرية الاقتصادية والقياس التجريبي للعلاقات الاقتصادية باستخدام الأساليب الرياضية والاحصائية, استخدم \"الاقتصاد القياسي\"", language_id: (Language.find_by name: 'ar').id).id])
