Relationship.create([subject_id: (Resource.find_by literal: 'T0000642').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "The development of propositions in economic theory by symbolic methods of reasoning.  The term is generally used with respect to an abstract treatment of the subject.  For the verification of economic theory and empirical measurement of economic relations by mathematical and statistical methods, use ECONOMETRICS", language_id: (Language.find_by name: 'en').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000642').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Разработка выкладок экономической теории методом символических рассуждений. Термин обычно используется, когда речь идет об абстрактном рассмотрении предмета. Применительно к апробированию экономической теории и эмпирическому измерению экономических отношений математическими и статистическими методами пользоваться рубрикой \"Эконометрия\"", language_id: (Language.find_by name: 'ru').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0000642').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "El desarrollo de proposiciones en teoría económica mediante métodos simbólicos de razonamiento. El término es usado generalmente en el contexto de un tratamiento abstracto del tema. Para la verificación de la teoría económica y para la medición empírica de las relaciones económicas por medio de métodos matemáticos y estadísticos, úsese ECONOMETRIA", language_id: (Language.find_by name: 'es').id).id])
